import React, { useState } from 'react'
import Recipes from '../recipes'

const images = [
  {
   url: "https://cdn.dummyjson.com/recipe-images/46.webp", 
   name: 'Pasta'
  },
  {
  url: "https://cdn.dummyjson.com/recipe-images/28.webp", 
  name: 'Breakfast'
  },
  {
  url: "https://cdn.dummyjson.com/recipe-images/49.webp", 
  name: 'Salad'
  },
  {
  url: "https://cdn.dummyjson.com/recipe-images/42.webp", 
  name: 'Stir-Fry'
  },
  {
  url: "https://cdn.dummyjson.com/recipe-images/22.webp", 
  name: 'Smoothies'
  },
  {
  url: "https://cdn.dummyjson.com/recipe-images/3.webp", 
  name: 'Desserts'
  },
]

const SuperDelicious = () => {
  const [recipeData, setRecipeData] = useState(null)

  const handleRecipes = (data) => {
    setRecipeData(data.recipes)
  }

  return (
    <div>
      <Recipes endpoint={'recipes?limit=0'} type={'image'} onDataFetched={handleRecipes} />
      <h1 className='text-4xl font-bold font-serif ml-5'>Super Delicious</h1>
      <div className='food-photo'>
        <img src={recipeData[9]?.image} alt='food' />
        <div>{recipeData[0]?.ingredients}</div>
      </div>
      <div className='food-information'>
        <div><img src='./5stars.png' alt='food' /></div>
        <p></p>
        <div></div>
        <div>
          <div></div>
          <div></div>
        </div>
      </div>
    </div>
  )
}

export default SuperDelicious
